import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./Home.css";

export default function Home() {
  const [searchQuery, setSearchQuery] = useState("");
  const [suggestions, setSuggestions] = useState([]);

  const medicines = ["Paracetamol", "Dolo 650", "Azithromycin", "Cough Syrup", "Crocin", "Aspirin"];

  const handleSearch = (e) => {
    const query = e.target.value;
    setSearchQuery(query);

    if (query.length > 0) {
      const filtered = medicines.filter((med) =>
        med.toLowerCase().includes(query.toLowerCase())
      );
      setSuggestions(filtered);
    } else {
      setSuggestions([]);
    }
  };

  return (
    <div>
      {/* Hero Section with Carousel */}
      <div id="heroCarousel" className="carousel slide" data-bs-ride="carousel">
        <div className="carousel-inner">
          <div className="carousel-item active hero-slide">
            <img
              src="https://source.unsplash.com/1600x500/?pharmacy,medicine"
              className="d-block w-100"
              alt="Pharmacy"
            />
            <div className="carousel-caption d-flex flex-column justify-content-center align-items-center overlay-search-bar">
              <div className="welcome-text">
                <h1>Welcome to MediQ</h1>
                <p>Your trusted online pharmacy</p>
              </div>
              <div className="search-box position-relative w-100">
                <input
                  type="text"
                  className="form-control form-control-lg"
                  placeholder="Search medicines, health products, or symptoms..."
                  value={searchQuery}
                  onChange={handleSearch}
                />
                {suggestions.length > 0 && (
                  <div className="suggestions">
                    <ul>
                      {suggestions.map((item, index) => (
                        <li key={index} onClick={() => setSearchQuery(item)}>
                          {item}
                        </li>
                      ))}
                    </ul>
                  </div>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Features Section */}
      <section className="container my-5 section-fade">
        <div className="row text-center">
          <div className="col-md-4 mb-4">
            <div className="card shadow h-100">
              <div className="card-body">
                <div className="fs-1 text-primary mb-3">ðŸ”Ž</div>
                <h3>Search Medicines</h3>
                <p className="text-muted">
                  Find medicines by name, category, or symptoms easily.
                </p>
              </div>
            </div>
          </div>
          <div className="col-md-4 mb-4">
            <div className="card shadow h-100">
              <div className="card-body">
                <div className="fs-1 text-success mb-3">ðŸ›’</div>
                <h3>Order Online</h3>
                <p className="text-muted">
                  Place your orders quickly and get home delivery.
                </p>
              </div>
            </div>
          </div>
          <div className="col-md-4 mb-4">
            <div className="card shadow h-100">
              <div className="card-body">
                <div className="fs-1 text-danger mb-3">ðŸ’Š</div>
                <h3>Ayurveda & Wellness</h3>
                <p className="text-muted">
                  Explore ayurvedic and wellness products curated for you.
                </p>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Quick Links */}
      <section className="container my-5 section-fade">
        <h2 className="text-center mb-4">Quick Links</h2>
        <div className="d-flex justify-content-center gap-3 flex-wrap">
          <a href="/ayurveda" className="btn btn-outline-primary">Ayurveda</a>
          <a href="/blogs" className="btn btn-outline-success">Health Blogs</a>
          <a href="/orders" className="btn btn-outline-dark">My Orders</a>
        </div>
      </section>
    </div>
  );
}
